Comment on Posts: As a user, I want to be able to comment on posts on the Social Media Networks application.
Like Posts: As a user, I want to be able to like posts on the Social Media Networks application.
Follow Users: As a user, I want to be able to follow other users on the Social Media Networks application.
Search for Posts: As a user, I want to be able to search for posts on the Social Media Networks application.
}
Administrative Tasks {
